response.activities:
- Защита прав потребителей;
- Жилищные дела;
- Семейные споры;
- Помощь юриста при ДТП, страховые споры;
- Наследственные дела;
- Взыскание задолженности договорам, распискам.
- Представительство в судах;
- Исполнительное производство;
- Сопровождение сделок с недвижимостью;
- Программа «Семейный (личный) адвокат».
- Абонентское юридическое обслуживание (аутсорсинг);
- Регистрация юридических лиц;
- Ликвидация юридических лиц;

Составление исковых заявлений, договоров, претензий, жалоб и др.
